import React from "react";
import { Link, Outlet } from "react-router-dom";

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <Link to="/t">t</Link>
      <Outlet />
    </div>
  );
};

export default Dashboard;
